COMPONENT.script:
initialize()=
declare
	IE			= InputEvent;

	alphaproc		= procedure;
	betaproc		= procedure;
	gammaproc		= procedure;
enddeclare
{

}

on click gobtn =
declare
	responseagent	= Object default null;
	response		= StringObject default null;
	arr				=  array of Object;
enddeclare
{
	arr[1] = ToString(text=stringresponse);
	arr[2] = field(highlightfield);
	arr[3] = curframe.Scope.GetProcHandle(name=procresponse);
	arr[4] = field(cursorfield).Cursor;

	case responsenature of
	1:	responseagent=arr[1];
	2:	responseagent=arr[2];
	3:	responseagent=arr[3];
	4:	responseagent=arr[4];
	5:	responseagent=arr;
	endcase;

	response = IE.DescribeEventBehavior(
		location=field(targetfield),
		eventkey=eventkey,
		responseagent=responseagent);

	field(targetfield).ToolTipText = response.Value;
}


procedure alphaproc = {}
procedure betaproc = {}
procedure gammaproc = {}

